let containerStyle = {
  display: "flex",
  width: "calc(65vw - 28px)",
  minWidth: "400px",
  fontWeight: "bold",
  textTransform: "capitalize"
}

let containerMainStyle = {
  fontSize: "17px",
  minWidth: "200px",
  height: "25px",
  textAlign: "center",
  fontWeight: "bold"
}

let containerOtherStyle = {
  display: "flex",
  marginLeft: "10px",
  width: "100%",
}

let indexStyle = {
  width: "16.667%",
  textAlign: "center",
}

export {
  containerStyle,
  containerMainStyle,
  containerOtherStyle,
  indexStyle,
}
